import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import AnnotateImage from "./components/annotate";
import UploadImages from "./components/upload";
import ImageAnnotation from "./components/imageannotation";
import ImageTable from "./components/list";
import ModelsTable from './components/modellist';
import RuleCreationPage from "./components/createrule";
import Layout from './components/Layout';
import TableComponent from './components/viewrules';
import DeploymentTable from './components/viewdeploy';


// HOC for authentication check
const ProtectedRoute = ({ element: Component, ...rest }) => {

  const [isAuthenticated, setIsAuthenticated] = useState(true);

  // Check if user is authenticated, otherwise redirect to login
  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    // Add your authentication logic here to check if the userEmail is valid
    const isValidUser = userEmail !== null && userEmail !== '';
    console.log(userEmail);
    console.log(isValidUser);
    setIsAuthenticated(isValidUser);
    console.log(isAuthenticated);
  }, []);

  useEffect(() => {
    console.log(isAuthenticated);
  }, []);

  if (!isAuthenticated) {
    return <Navigate to="/login" />;
  }

  return <Route {...rest} render={(props) => <Component {...props} />} />;
};

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route path="login" element={<Login />} />
          <Route path="register" element={<Register />} />
          <Route path="annotate" element={<ProtectedRoute element={<AnnotateImage />} />} />
          <Route path="upload" element={<ProtectedRoute element={<UploadImages />} />} />
          <Route path="imageannotation/:requestID" element={<ProtectedRoute element={<ImageAnnotation />} />} />
          <Route path="dataset">
            <Route path="view" element={<ProtectedRoute element={<ImageTable />} />} />
            <Route path="upload" element={<ProtectedRoute element={<UploadImages />} />} />
          </Route>
          <Route path="model">
            <Route path="view" element={<ProtectedRoute element={<ModelsTable />} />} />
            <Route path="train" element={<ProtectedRoute element={<ImageTable />} />} />
          </Route>
          <Route path="rules">
            <Route path="create" element={<ProtectedRoute element={<RuleCreationPage />} />} />
            <Route path="view" element={<ProtectedRoute element={<TableComponent />} />} />
          </Route>
          <Route path="deploy" element={<ProtectedRoute element={<DeploymentTable />} />} />
        </Route>
      </Routes>
    </Router>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
